import React, { useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const useStyles = makeStyles({
  table: {
    minWidth: 650,
  },
});

export default function BasicTable() {
    const [rows,updateState] = useState([])

    const classes = useStyles();

    // let rows=[];

    if(rows.length === 0)    
    {
        fetch("http://localhost:5000/generate-report/rooms")
        .then((data) => data.json())
        .then(response => {
            console.log(response)
            updateState(response);
        })
        .catch(err => {
            console.log(err)
        })
    }
    
    
  return (
    <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Room Number</TableCell>
            <TableCell >Room Type</TableCell>
            <TableCell >Room Floor</TableCell>
          </TableRow>
        </TableHead>
        
        <TableBody>
             { rows.map((row) => (
                    <TableRow key={row.roomnumber}>
                        <TableCell component="th" scope="row">{row.roomnumber}</TableCell>
                        <TableCell component="th" scope="row" >{row.roomtype}</TableCell>
                        <TableCell>{row.roomfloor}</TableCell>
                    </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
